import { Langcontext } from './context/Langcontext';
import Header from './includes/Header';
import './Mainpage.css'


function Mainpage() {
    const { context, setcontext}= useContext(Langcontext)
    setcontext("wqeq")

    function changelang(val) {
        setcontext(val)
    }

  return (
    <div>
    <Header></Header>        
    </div>
  )
}

export default Mainpage
